import React, { useState} from 'react';


function Data(){ 
 return [
		{
		data1: {
		question:`what's your name?`,
		punchline:`why should I say`,
		}
		,
		data2: {
		question:`hello`,
		punchline:`bye`,
		}
		,
		data3:{
		question:`hello`,
		punchline:`bye`,
		}
		,
 }
 
 
 ]	
		
}
export default Data
